  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0113757 includes chemical,
  discrete sample, physical and profile data collected from JAMES CLARK ROSS in the
  North Greenland Sea and Norwegian Sea from 1996-07-20 to 1996-08-22 and retrieved
  during cruise CARINA/74JC19960720. These data include ALKALINITY, CHLOROFLUOROCARBON-11
  (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
  tetrachloride (CCL4), DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN, HYDROSTATIC
  PRESSURE, NITRATE, PHOSPHATE, Potential temperature (theta), SALINITY, SILICATE,
  SULFUR HEXAFLUORIDE (SF6) and WATER TEMPERATURE. The instruments used to collect
  these data include CTD and bottle. These data were collected by I. Skelvan of Commonwealth
  Scientific and Industrial Research Organization, Andrew Watson of Plymouth Marine
  Laboratory and Truls Johannessen of University of Bergen; Bjerknes Center for Climate
  Research; Geophysical Institute as part of the CARINA/74JC19960720 data set.nnThe
  CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis project is an international
  collaborative effort of the EU IP CARBOOCEAN, and U.S. partners. It has produced
  a merged internally consistent data set of open ocean subsurface measurements for
  biogeochemical investigations, in particular, studies involving the carbon system.
  The original focus area was the North Atlantic Ocean, but over time the geographic
  extent expanded and CARINA now includes data from the entire Atlantic, the Arctic
  Ocean, and the Southern Ocean.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
